import {InputGroup} from "react-bootstrap";

export function LinkPicker() {
    return (
        <div>
            <h2>Link picker</h2>
            <div>
                <h3>Metro</h3>
                <InputGroup>
                    <InputGroup.Checkbox label="Select All" />
                    <InputGroup.Checkbox label="A" />
                    <InputGroup.Checkbox label="B" />
                    <InputGroup.Checkbox label="C" />
                </InputGroup>
            </div>
        </div>
    );


}
